import React from 'react'

import Sectors from 'C:/MY_PROJECT/final/src/rawData/sectorNames.json'

import Image from "C:/MY_PROJECT/final/src/rawData/Screenshot_2019-09-23-18-40-49-48.png"

const UserPage = () => {

  var sectorName =Sectors

  function check(){
    alert(document.getElementById("sector").innerHtml)
  }

  var image=Image
  const myStyle={
    // backgroundImage:'url('+{item.back_image}+')',
    // color:"red",
    // backgroundColor:"white"
  }

  return (
    <div className="userPage">
        This is user Page
        <div className='userPageCards m-3'>
            {sectorName.map(item => 
                        <li key={item.sector_name} 
                            className='sector' 
                            style={{backgroundImage:'url('+item.back_image+')', color:"red"}}>
                                
                                {item.sector_name}
                        
                        </li>

                        
            )}
        </div>
       
        <div style={{backgroundImage: `url(${image})`, width:'100%'}}>Test</div>
        
    </div>
  )
}

export default UserPage
